"use strict";(self.webpackChunkauthApp=self.webpackChunkauthApp||[]).push([[499],{7499:e=>{e.exports=JSON.parse('[{"key":"0","label":"\xc0 propos de nous","children":[{"key":"0-0","label":"Depuis combien de temps l\'entreprise existe-t-elle?","data":"/faqs","txt":{"es":"Nous avons plusieurs startups de commerce \xe9lectronique, nous innovons toujours et notre \xe9quipe est tr\xe8s exp\xe9riment\xe9e dans ce nouveau monde du commerce. N\'h\xe9sitez pas \xe0 faire confiance \xe0 nos mains pour s\xe9lectionner vos nouvelles chaussures."},"type":"url"},{"key":"0-1","label":"O\xf9 sont-elles?","data":"/faqs","txt":{"es":"Notre soci\xe9t\xe9 est enregistr\xe9e en Espagne, mais uniquement \xe0 des fins administratives. Notre march\xe9 est le monde et nous ne croyons pas aux fronti\xe8res comme limite au commerce."},"type":"url"}]},{"key":"1","label":"sur les prix","children":[{"key":"1-0","label":"Pourquoi les prix si bas ?","data":"/faqs","txt":{"es":"<p>Nous croyons et travaillons pour g\xe9n\xe9rer de nombreuses ventes. Cela nous permet de r\xe9duire nos marges b\xe9n\xe9ficiaires. D\'autres entreprises choisissent de tripler les prix de revient. Nous pr\xe9f\xe9rons cr\xe9er une communaut\xe9. Gr\xe2ce au fait que nous avons des prix directs d\'usine, nous pouvons les r\xe9duire significativement par rapport \xe0 la r\xe9alit\xe9 des autres vendeurs</p>"},"type":"url"}]},{"key":"2","label":"\xc0 propos des exp\xe9ditions","children":[{"key":"2-0","label":"Comment se d\xe9roule le processus d\'exp\xe9dition ?","data":"/faqs","txt":{"es":"<p>1- Le paiement est effectu\xe9. <br>2- Le paiement est trait\xe9. <br>3- La commande est trait\xe9e et exp\xe9di\xe9e. (24 / 48 heures) Dans des cas tr\xe8s sp\xe9cifiques, ce d\xe9lai peut \xeatre un peu plus long, atteignant jusqu\'\xe0 72 heures. <br>4- La commande arrive \xe0 votre adresse. (Le d\xe9lai de livraison d\xe9pend de l\'envoi s\xe9lectionn\xe9). Certains pays (en dehors des \xc9tats-Unis, du Canada et de la Communaut\xe9 europ\xe9enne) peuvent avoir des retards sp\xe9cifiques li\xe9s \xe0 leur syst\xe8me de messagerie national.</p>"},"type":"url"},{"key":"2-1","label":"Quels types d\'envois effectuez-vous ?","data":"/faqs","txt":{"es":"<p>Nous travaillons avec deux types d\'exp\xe9dition:<br> 1- EXP\xc9DITION EXPRESS - Cette exp\xe9dition a un co\xfbt suppl\xe9mentaire et prend entre 15 et 20 jours ouvrables \xe0 partir du moment o\xf9 la commande a \xe9t\xe9 trait\xe9e.<br> 2- EXP\xc9DITION GRATUITE * - Cet envoi n\'est disponible que pour les achats sup\xe9rieurs \xe0 99,99 \u20ac<br>* non disponible pour certains pays - pour plus d\'informations, consultez le formulaire de contact</p>"},"type":"url"},{"key":"2-2","label":"Envoyez-vous de l\'argent \xe0 la livraison ?","data":"/faqs","txt":{"es":"<p>Lorsqu\'il s\'agit d\'envois internationaux, il est tr\xe8s difficile d\'avoir ce type de service. Pour cette raison, nous avons d\xe9cid\xe9 de ne pas avoir cette modalit\xe9</p>"},"type":"url"},{"key":"2-3","label":"Que se passe-t-il si je ne suis pas chez moi le jour de la livraison?","data":"/faqs","txt":{"es":"<p>Dans ce cas, le livreur laissera un avis de passage* avec lequel vous devrez vous pr\xe9senter au bureau de poste muni de votre pi\xe8ce d\'identit\xe9. Dans tous les cas, un membre de la famille qui est \xe0 ce moment-l\xe0 pourrait \xe9galement en faire l\'exp\xe9rience. <br> Gardez \xe0 l\'esprit qu\'il ne peut s\'\xe9couler plus de 15 jours apr\xe8s la visite du livreur, car si cela se produit, la poste renverra le colis \xe0 l\'exp\xe9diteur. Si cela se produit, vous devrez payer \xe0 nouveau les frais d\'exp\xe9dition afin que nous puissions le renvoyer une fois que nous l\'aurons re\xe7u. <br> * Il peut y avoir des diff\xe9rences de traitement selon le pays de destination.</p>"},"type":"url"},{"key":"2-4","label":"Que puis-je faire si je ne re\xe7ois pas ma commande ?","data":"/faqs","txt":{"es":"<div><p>Sur la base du fait que nous effectuons des envois internationaux, bien que ce ne soit pas habituel, ceux-ci pourraient \xe9ventuellement \xeatre perdus ou avoir un probl\xe8me qui emp\xeache leur localisation. Pour cette raison, nous avons une assurance remboursement.</p><p>Pour demander un remboursement, 60 jours ouvrables doivent s\'\xeatre \xe9coul\xe9s \xe0 compter de la date d\'exp\xe9dition et vous devez en faire la demande par e-mail en pr\xe9cisant la r\xe9f\xe9rence de la commande \xe0 notre e-mail d\'assistance aux remboursements salut@nowsneakers.com. </p><p>Pour demander un remboursement, 60 jours ouvrables doivent s\'\xeatre \xe9coul\xe9s \xe0 compter de la date d\'exp\xe9dition et vous devez en faire la demande par e-mail en pr\xe9cisant la r\xe9f\xe9rence de la commande \xe0 notre e-mail d\'assistance salut@nowsneakers.com.</p><p>Une fois le remboursement de la commande demand\xe9, notre \xe9quipe \xe9valuera votre dossier et vous communiquera une r\xe9solution sous 72h. Si votre demande est approuv\xe9e, le montant total sera rembours\xe9, si possible par le m\xeame mode de paiement qui a effectu\xe9 l\'achat</p></div>"},"type":"url"}]},{"key":"3","label":"sur les paiements","children":[{"key":"3-0","label":"Quelles m\xe9thodes de paiements sont disponibles?","data":"/faqs","txt":{"es":"<div><p>Les paiements actuellement disponibles peuvent \xeatre consult\xe9s <a href=\'/way-to-pay\'>ici</a>.</p></div>"},"type":"url"},{"key":"3-1","label":"S\xe9curit\xe9 SSL?","data":"/faqs","txt":{"es":"<div><p>Un certificat SSL (Secure Sockets Layer) est un certificat num\xe9rique qui authentifie l\'identit\xe9 d\'un site Web et crypte les informations envoy\xe9es au serveur \xe0 l\'aide de la technologie SSL. Un certificat sert de \\"passeport\\" \xe9lectronique qui \xe9tablit les informations d\'identification d\'une entit\xe9 en ligne lorsqu\'elle fait des affaires sur le Web.</p><p>En d\'autres termes, cela garantit que personne ne peut voir les informations entre les communications entre client et serveur, ce qui emp\xeache quiconque de voir des donn\xe9es essentielles telles que des num\xe9ros de carte de cr\xe9dit, des identifiants, des mots de passe et d\'autres donn\xe9es personnelles.</p></div>"},"type":"url"}]}]')}}]);